Promotional info - &quot;Somewhere at the end of time, all the gods of the universe are enslaved, working to build a machine that will forever change the face of creation. What is...the Godbomb? And what can Thor, the last free god in all the cosmos, do to stop it? As Gorr's master plan continues to unfold, all hope for divinity is lost as Thor finds himself in chains alongside his fellow gods. As the clock ticks down on one very large bomb, as enslaved gods look to the skies for a savior, enter...the Girls of Thunder?&quot;

This is the digital copy of the hardcover edition by Zone-Empire. Thanks to them for their efforts, please seed and enjoy! :-)

